                                <option aria-label="None" value="" />
                                <option >ITEM 1</option>
                                <option >ITEM 2</option>
                                <option >ITEM 3</option>
                            </Select>
                        </FormControl>

                        <hr />
                        <div className="formularioCadastro_div_h3">
                            <h3>SCHEDULAGEM</h3>
                        </div>

                        <TextField style={{ marginLeft: '20px', width: '45%' }}
                            onChange={(recebe) => { setCalendario(recebe.target.value) }}

                            id="Calendario"
                            label="Calendario"
                            variant="outlined"
                            className="FormularioCadastro_inputs"
                            margin="dense"
                            multiline
                        />
                        <TextField style={{ marginLeft: '20px', width: '45%' }}
                            onChange={(recebe) => { setHorario_inicio(recebe.target.value) }}
                            id="Horario_inicio"
                            label="Horario de inicio"
                            variant="outlined"
                            className="FormularioCadastro_inputs"
                            margin="dense"
                            multiline
                        />

                        <TextField style={{ marginLeft: '20px', width: '45%' }}
                            onChange={(recebe) => { setPeriodicidade(recebe.target.value) }}
                            id="Periodicidade"
                            label="Periodicidade"
                            variant="outlined"
                            className="FormularioCadastro_inputs"
                            margin="dense"
                            multiline
                        />

                        <TextField style={{ marginLeft: '20px', width: '45%' }}
                            onChange={(recebe) => { setHorario_Termino(recebe.target.value) }}
                            id="Horario_Termino"
                            label="Horario de Termino"
                            variant="outlined"
                            className="FormularioCadastro_inputs"
                            margin="dense"
                            multiline
                        />

